"I think the biggest challenge was the sheer amount of gear and food each individual needed to carry. We used a divide and conquer strategy to overcome this, which was fun coming from an individual sport. It was nice to have that team element bring us all together and have others around me where I felt truly supported. The other challenge was the mileage and hours. You have to take a progression over a perfection mindset for a trip like this. You need to keep moving forward and never sweat the small stuff. I think that the same attitude could be applied to 2020 in general. Most people are just doing their best with the circumstances they have been dealt. These are the great life lessons I get to experience and learn through sport and share with others." 

